import "./CostItem.css";

function CostItem({ props }) {
  return (
    <div class="container">
      <div class="row">
        <div class="product-name">{props.name}</div>
        <div class="price-name">{props.price}$</div>
      </div>
      <div className="row">
      <div class="date-name">{props.date.toLocaleDateString()}</div>
      <div class="price-name">123</div>
      </div>
    </div>
  );
}

export default CostItem;
